    value: This serves to provide clarification of the one-time adjustment of $2
  - value: '505.79'
  - value: ' which is itemized on Schedule B supporting Line 21(b) of the Detailed
      Summary Page.  The Boeing Company Political Action Committee makes every effort
      to comply with all Federal election laws.  To that end'
  - value: ' we recently contracted with a firm to conduct an external audit of the
      PAC bank account to assist us in flushing out a discrepancy between the bank
