  expected_count: 4
  input: TEXT,SB21B,B3702,"This serves to provide clarification of the one-time adjustment
    of $2,505.79, which is itemized on Schedule B supporting Line 21(b) of the Detailed
    Summary Page.  The Boeing Company Political Action Committee makes every effort
    to comply with all Federal election laws.  To that end, we recently contracted
    with a firm to conduct an external audit of the PAC bank account to assist us
    in flushing out a discrepancy between the bank balance and the FEC report balance."
  input_count: 7
  record: <fec.version.v3.TEXT.Records instance at 0x2669b90>
  result: []
- attempt:
  - name: REC TYPE
    number: '1'
    value: TEXT
  - name: FORM TYPE
    number: '2'
    value: SB21B
  - name: BACK REF TRAN ID
    number: '3'
    value: B3702
  - name: TEXT4000
    number: '4'
    value: (cont'd.) Internally we had already meticulously accounted for all transactions
      in the last three years; however
  - value: ' repeated review of activity prior to 1999 did not assist us in defining
      the origin of the remaining $2'
  - value: 505.79 difference.  It is our belief that old mathematical discrepancies
      lie at the heart of the matter.  Now
  - value: ' in order to bring the FEC Report totals in line with our bank records'
  - value: ' we are disclosing the one-time balance correction on Line 21(b) as if
      it were an operating expenditure.'
  expected_count: 4
  input: TEXT,SB21B,B3702,"(cont'd.) Internally we had already meticulously accounted
    for all transactions in the last three years; however, repeated review of activity
    prior to 1999 did not assist us in defining the origin of the remaining $2,505.79
    difference.  It is our belief that old mathematical discrepancies lie at the heart
    of the matter.  Now, in order to bring the FEC Report totals in line with our
    bank records, we are disclosing the one-time balance correction on Line 21(b)
    as if it were an operating expenditure."
  input_count: 8
  record: <fec.version.v3.TEXT.Records instance at 0x2669a28>
  result: []
