    value: (cont'd.) As you will note
  - value: ' since our report balance exceeds the actual bank balance'
  - value: ' at worst we have over-reported past activity.  This adjustment does not
      consist of any new or previously undisclosed PAC receipts.  We hope this cover
      letter will be an adequate clarification of the one-time adjustment disclosed
      on this report.  However'
  - value: ' if you have any questions'
  - value: ' or if anything further is required of The Boeing Company Political Action
      Committee'
  - value: ' please call Amy Reynolds at (703) 684-2915.'
  expected_count: 4
  input: TEXT,SB21B,B3702,"(cont'd.) As you will note, since our report balance exceeds
    the actual bank balance, at worst we have over-reported past activity.  This adjustment
    does not consist of any new or previously undisclosed PAC receipts.  We hope this
    cover letter will be an adequate clarification of the one-time adjustment disclosed
    on this report.  However, if you have any questions, or if anything further is
    required of The Boeing Company Political Action Committee, please call Amy Reynolds
    at (703) 684-2915."
